public class Solution {
    public static void main(String[] args) {
        String s = "";
//        System.out.println(new Solution().firstUniqChar(s));;
        System.out.println(Arrays.toString("aaaba".split("b")));
    }
    public int firstUniqChar(String s) {
        if(s.length() == 0){
            return -1;
        }
        if(s.length() == 1){
            return 0;
        }
        for (int i = 0; i < s.length(); i++) {
            String[] strings = s.split(s.charAt(i) + "");
            if(strings.length > 2){
                return i;
            }
        }
        return -1;
    }
}
